import React from 'react';
import { Nav, NavDropdown } from 'react-bootstrap';

function MoviesNavbar() {
  return (
    <Nav variant="dark" style={{ backgroundColor: 'orange' }}>
      <Nav.Item>
        <Nav.Link href="/" style={{ color: 'white', fontSize: '150%', fontStyle: 'italic' }}>
          <span role="img" aria-label="movie-icon" style={{ marginRight: '5px' }}> ðŸŽ¬  Movies  </span>
        </Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/genres" style={{ color: 'white' }}>
          Genres
        </Nav.Link>
      </Nav.Item>

      <NavDropdown title="Account" id="basic-nav-dropdown" style={{ fontSize: '150%', marginLeft: '60%' }}>
        <NavDropdown.Item href="#login" style={{ color: 'white' }}>Login</NavDropdown.Item>
        <NavDropdown.Item href="#register" style={{ color: 'white' }}>Register</NavDropdown.Item>
      </NavDropdown>
    </Nav>
  );
}

export default MoviesNavbar;
